import React from 'react';
import SearchBar from './SearchBar';
import ImageList from './ImageList';
import '../statics/App.css';

class App extends React.Component {
  render() {
    return (
      <Container maxWidth="sm">
        <SearchBar />
        <ImageList />
      </Container>
    );
  }
}

export default App;
